import React from 'react';
import './TopBar.css'

interface TopBarProps {
  onButtonClick: (textContent: string) => void;
  textContent: string;
}

function TopBar({ onButtonClick, textContent }: TopBarProps) {
  return (
    <nav className="top-bar">
      <div className="button-container">
        <button
          className='github'
          title="github page"
          onClick={() => onButtonClick(textContent)}
        ></button>
        <p>2222222222222222222222222222222</p>
        <button className='text-button'>Delyan Kirov</button>
      </div>
    </nav>
  );
}

export default TopBar;
